import Card from './Card';
import styled from 'styled-components';

const patuta = styled.div`color: brown;
border: 3px solid goldenrod;
border-style: inset;
font-weight: Times New Roman
display: flex;
felx-direction: row;
justify-content: space-between;
margin: auto;
padding: 2 em;`
export default function Cards({characters}) {
   return (<div>
      {characters.map(char=>{
         return <Card
         name= {char.name}
         species={char.species}
         gender= {char.gender}
         image={char.image}
         onClose={()=>window.alert('Emulando el cierre')}></Card>
      })
   }
   </div>
)
}
